import React from 'react';
import './App.css';
import titleimg from'./img/titleimg.png';
import {BrowserRouter, Route} from 'react-router-dom';



function App() {
  return (
    <body>
      <div class="title">
        <div><img class="Titleimg"src={titleimg} alt="titleimg"/></div>    
      </div>
      <Router>
      <header>
      <div class="top_menu">
    <ul>
        <li><button>메인으로</button></li>
        <li> |</li>
        <li><button>정책 페이지</button></li>  
    </ul>
</div>
</header>
</Router>
<div class="main">
<iframe class="mains" src="https://www.youthcenter.go.kr/youngPlcyUnif/youngPlcyUnifList.do"></iframe>
<div class="lnb">
</div>
</div>
    </body>


  );
}

export default App;
